import React from 'react';
import '../../App.css';

class signUp extends React.Component{
  constructor(props) {
    super(props)

    this.state = {
         username:'',
         name:'',
         contact:'',
         password:"",
         confrimPassword:"",
         emailid:"",
    }
}
handlenameChange = (e) => {
  this.setState({
    name : e.target.value
  })
}
handleusernameChange = (e) => {
  this.setState({
    username : e.target.value
  })
}
handlecontactChange = (e) => {
  this.setState({
    contact : e.target.value
  })
}
handlepasswordChange = (e) => {
  this.setState({
    password : e.target.value
  })
}
handleconfirmpassChange = (e) => {
  this.setState({
    confrimPassword : e.target.value
  })
}
handleemailChange = (e) => {
  this.setState({
    emailid : e.target.value
  })
}
  render(){
    return(
      <>
     <form onSubmit={this.handleSubmit}>
     <div>
                    <label>name</label>
                    <input type='text' value={this.state.name} onChange={(e)=> this.handlenameChange(e)}/>
                </div>
                <div>
                    <label>Username</label>
                    <input type='text' onChange={(e)=> this.handleusernameChange(e)}/>
                </div>
                <div>
                    <label>email id</label>
                    <input type='text' onChange={(e)=> this.handleemailChange(e)}/>
                </div>
                <div>
                    <label>contact</label>
                    <input type='text'onChange={(e)=> this.handlecontactChange(e)}/>
                </div>
                <div>
                    <label>password</label>
                    <input type='text' onChange={(e)=> this.handlepasswordChange(e)}/>
                </div>
                <div>
                    <label> confirm password</label>
                    <input type='text' onChange={(e)=> this.handleconfirmpassChange(e)}/>
                </div>

                <div>
                    <button vlue="submit">submit</button>
                </div>
            </form>
      </>
    )
  }
}
export default signUp;
